import React from "react";
import { NavLink } from "react-router-dom";

const SignOutLinks = () => {
  return (
    <ul className="right">
      <li>
        <NavLink to="/">About</NavLink>
      </li>
      <li>
        <NavLink to="/signin">SignIn</NavLink>
      </li>
      <li>
        <NavLink to="/">SignUp</NavLink>
      </li>
    </ul>
  );
};

export default SignOutLinks;
